@Bot.on_callback_query(group = 6565)
def grs_callback(client, callback_query):
    data = callback_query.data
    
    if data.startswith("junmp1_"):
        # Extract the button number from the callback data
        button_number = int(data.split("_")[1])
         
        # Check if the button number is within the valid range
        if 1 <= button_number <= len(junmp1):
            # Get the corresponding text from the JSON list
            text = junmp1[button_number - 1]

            # Update the inline keyboard for the next and previous buttons
            keyboard = [
                [
                    InlineKeyboardButton("Previous", callback_data=f"junmp1_{button_number - 1}"),
                    InlineKeyboardButton("Close", callback_data=f"close"),
                    InlineKeyboardButton("Next", callback_data=f"junmp1_{button_number + 1}"),
                ]
            ]

            reply_markup = InlineKeyboardMarkup(keyboard)

            # Edit the message with the new text and updated buttons
            callback_query.message.reply_text(
                text=text,
                reply_markup=reply_markup,
                protect_content = True,
                parse_mode=ParseMode.HTML,
                disable_web_page_preview=True,
            )
